import FieldsetCarousel from "./Carousel";
import React from "react";

const Paint = () => {
    const form = [
        {
          title: 'Item 1',
          description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.',
        },
        {
          title: 'Item 2',
          description: 'Praesent auctor, est in bibendum faucibus, mauris elit ullamcorper elit.',
        },
        {
          title: 'Item 3',
          description: 'Nulla'
        }]

      return <FieldsetCarousel form={form}/>
    }

    export default Paint;
